  * { box-sizing: border-box; }
  body {
    font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
    background: #0f0f0f;
    color: #f1f1f1;
    margin: 0;
    padding: 2rem;
  }
  h1 {
    text-align: center;
    font-size: 1.5rem;
    margin-bottom: 2rem;
    color: #00bcd4;
  }
  .gallery {
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
    gap: 1.5rem;
  }
  .card {
    background: #1e1e1e;
    border-radius: 12px;
    overflow: hidden;
    box-shadow: 0 4px 15px rgba(0, 0, 0, 0.5);
    transition: transform 0.3s ease;
  }
  .card:hover {
    transform: translateY(-5px);
  }
  .card a {
    display: block;
  }
  .card img {
    width: 100%;
    display: block;
    height: auto;
    border-bottom: 1px solid #333;
    transition: opacity 0.3s ease;
  }
  .card img:hover {
    opacity: 0.85;
  }
  </style>
